  [],\n\t\"revision_timestamp\": \"2013-03-14T21:42:15.740787\",\n\t\"name\": \"eaarl-coastal-topography-virginia-post-norida-2009\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A digital elevation model (DEM) of a portion
  of the Virginia coastline beachface, post-Nor'Ida (November 2009 nor'easter), was
  produced from remotely sensed, geographically referenced elevation measurements
  by the U.S. Geological Survey (USGS). Elevation measurements were collected over
  the area using the Experimental Advanced Airborne Research Lidar (EAARL), a pulsed
  laser ranging system mounted onboard an aircraft to measure ground elevation, vegetation
  canopy, and coastal topography. The EAARL sensor suite includes the raster-scanning,
  water-penetrating full-waveform adaptive lidar, a down-looking red-green-blue (RGB)
  digital camera, a high-resolution multispectral color-infrared (CIR) camera, two
  precision dual frequency kinematic carrier-phase GPS receivers, and an integrated
  miniature digital inertial measurement unit, which provide for sub-meter georeferencing
  of each laser sample. The system uses high-frequency laser beams directed at the
  Earth's surface through an opening in the bottom of the aircraft's fuselage. The
  laser system records the time difference between emission of the laser beam and
  the reception of the reflected laser signal in the aircraft. The plane travels over
  the target area at approximately 50 meters per second at an elevation of approximately
  300 meters, resulting in a laser swath of approximately 240 meters with an average
  point spacing of 2-3 meters. The EAARL, developed originally by the National Aeronautics
  and Space Administration (NASA) at Wallops Flight Facility in Virginia, measures
  ground elevation with a vertical resolution of +/-15 centimeters. A sampling rate
  of 3 kilohertz or higher results in an extremely dense spatial elevation dataset.
  Over 100 kilometers of coastline can be surveyed easily within a 3- to 4-hour mission.
  When resultant elevation maps for an area are analyzed, they provide a useful tool
  to make management decisions regarding land development.\",\n\t\"license_title\":
